import { Pressable, StyleSheet } from "react-native";
import { Box, Text, HStack, VStack } from "native-base";
import { MaterialCommunityIcons } from "@expo/vector-icons";
import Svg, { Path } from "react-native-svg";

export function DietaryPreferences({
  dietaryPreferences,
  setDietaryPreferences,
}: {
  dietaryPreferences: string[];
  setDietaryPreferences: (dietaryPreferences: string[]) => void;
}) {
  const first4Preferences = preferences().slice(0, 4);
  const last3Preferences = preferences().slice(4, 7);

  const handleClick = (preference: string) => {
    if (dietaryPreferences.includes(preference)) {
      setDietaryPreferences(
        dietaryPreferences.filter((item) => item !== preference)
      );
    } else {
      setDietaryPreferences([...dietaryPreferences, preference]);
    }
  };

  return (
    <Box>
      <Text style={styles.textLabel}>Diet Preference</Text>
      <VStack space={4}>
        <HStack space={4}>
          {first4Preferences.map((preference) => {
            console.log(preference.name, "name");
            const isSelected = dietaryPreferences.includes(preference.name);
            return (
              <Pressable
                onPress={() => handleClick(preference.name)}
                key={preference.name}
                style={isSelected ? styles.dietBoxSelected : styles.dietBox}
              >
                <Box>{preference.icon}</Box>
              </Pressable>
            );
          })}
        </HStack>
        <HStack space={4}>
          {last3Preferences.map((preference) => {
            const isSelected = dietaryPreferences.includes(preference.name);
            return (
              <Pressable
                onPress={() => handleClick(preference.name)}
                key={preference.name}
                style={isSelected ? styles.dietBoxSelected : styles.dietBox}
              >
                <Box>{preference.icon}</Box>
              </Pressable>
            );
          })}
        </HStack>
      </VStack>
    </Box>
  );
}

const styles = StyleSheet.create({
  dietBox: {
    backgroundColor: "white",
    borderRadius: 10,
    padding: 8,
    borderColor: "black",
    borderWidth: 1,
    flexDirection: "column",
    width: 75,
    alignItems: "center",
    justifyContent: "center",
    height: 75,
  },
  dietBoxSelected: {
    backgroundColor: "lightgrey",
    borderRadius: 10,
    padding: 8,
    borderColor: "black",
    borderWidth: 1,
    flexDirection: "column",
    width: 75,
    alignItems: "center",
    justifyContent: "center",
    height: 75,
  },
  textLabel: {
    fontFamily: "Lato_700Bold",
    fontSize: 16,
    color: "black",
    marginBottom: 10,
  },
  container: {},
});

